import React, {Component} from 'react'

class DisplayInfo extends Component{

    render(){

        let theList = []
        let getData = function(){
            fetch('http://localhost:5000/get')
                    .then(response => response.json())
                    .then(data => {
                      // console.log(data.dbArray)
                        const dbReturn = data.dbArray.forEach(element => {
                            //console.log(element)
                            theList.push(element)  
                        })
                    })
                    .catch(error => console.error(error));
            }()

            console.log(theList)

            const showList = theList.map((x) => {
                <li key={x.name.toString()}>name:{x.name}, comment:{x.comment}</li>
            })

        return(
            <div>
                <p>this is the return from the api</p>
                <div className="showData">
                    <ul>{showList}</ul>
                </div>
            </div>



        )
    }
}

export default DisplayInfo;
